import React, { Component } from 'react';
import {Button, Dialog, Pane} from 'evergreen-ui';

let material_type = () => <Dialog
        isShown={true}
        title="Dialog title"
        onCloseComplete={() => setState({ isShown: false })}
        confirmLabel="Custom Label"
      >
        Dialog content
      </Dialog>

export {material_type};
